import React, { useState } from 'react';
import axios from 'axios';

const DataInput = () => {
    const [inputData, setInputData] = useState('');
    const [responseData, setResponseData] = useState(null);
    const [error, setError] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError(''); // Reset any previous errors
        try {
            const jsonData = JSON.parse(inputData); // Parse input JSON
            const response = await axios.post('http://localhost:3000/bfhl', jsonData);
            setResponseData(response.data);
        } catch (err) {
            console.error('Submission error:', err);
            setError('An error occurred while submitting data.');
            setResponseData(null);
        }
    };

    const renderResponse = () => {
        if (!responseData) return null;

        const output = {
            is_success: responseData.is_success,
            user_id: responseData.user_id,
            email: responseData.email,
            roll_number: responseData.roll_number,
            numbers: responseData.numbers,
            alphabets: responseData.alphabets,
            highest_lowercase_alphabet: responseData.highest_lowercase_alphabet,
            file_valid: responseData.file_valid,
            file_mime_type: responseData.file_mime_type,
            file_size_kb: responseData.file_size_kb
        };

        return <pre>{JSON.stringify(output, null, 2)}</pre>;
    };

    return (
        <div>
            <h1>Data Input</h1>
            <form onSubmit={handleSubmit}>
                <textarea
                    rows="5"
                    value={inputData}
                    onChange={(e) => setInputData(e.target.value)}
                    placeholder='Enter JSON here (e.g., {"data": ["A", "C", "Z", "c", "i"], "file_b64": "BASE_64_STRING"})'
                    required
                />
                <button type="submit">Submit</button>
            </form>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <h2>Response</h2>
            {renderResponse()}
        </div>
    );
};

export default DataInput;
